import Dashboard from '../components/admin/Dashboard';
import Products from '../components/admin/Products';
import Customers from '../components/admin/Customers';
import Users from '../components/admin/Users';

const routes = [ 
    { path: '/', exact: true, name: 'Admin', component: Dashboard},
    // { path: '/admin/dashboard', exact: true, name: 'Dashboard', component: Dashboard},
    { path: '/product-management', exact: true, name: 'Products', component: Products},
    { path: '/customer-management', exact: true, name: 'Customers', component: Customers},
    { path: '/user-management', exact: true, name: 'Users', component: Users}
];

export default routes;
